#define SC(a)  vec2(sin(a),cos(a))
void mainImage( out vec4 O, in vec2 f ){
    vec2 U = (f-iMouse.xy) / iResolution.y;
    vec4 tex = texture(iChannel0,U+0.5*20.0);
    for(float i=2., t = iTime*.7;i<38.;i++){
        U += i/7. * SC(i*29.1+t*.1 );
		O[int(i)%3] += sin(atan(U.x,U.y)+tex[int(i)%3] *0.05* + i * 11.32 + t ) * .33;
    }
    O += vec4(.7,.4,.4,0);
}
